$(document).ready((function(){const triggerList=document.querySelectorAll('[data-bs-toggle="tooltip"], [data-bs-toggle="popover"]');if(triggerList.length>0){const tooltipAndPopoverList=[...triggerList].map(triggerEl=>"tooltip"===triggerEl.getAttribute("data-bs-toggle")?new bootstrap.Tooltip(triggerEl):"popover"===triggerEl.getAttribute("data-bs-toggle")?new bootstrap.Popover(triggerEl):void 0)}}));